import GoogleMapReact from 'google-map-react';
import React from 'react';
import Marker from '../component/Marker';

function Map(props) {



    return (
        <div style={{ height: '100vh', width: '100%' }}>
            <GoogleMapReact
                //bootstrapURLKeys={{ key: /* YOUR KEY HERE */ }}
                defaultCenter={{ lat: -8.186231, lng: 112.478758 }}
                defaultZoom={14}
            >
                <Marker lat={-8.186231} lng={112.478758} name="Kapal1" color="red" />
            </GoogleMapReact>
        </div>
    );
}

export default Map;
